import React from 'react';
import ReactDOM from 'react-dom/client';



const root = ReactDOM.createRoot(document.getElementById('root'));

const shoot = (a) => {
  alert(a);
}

const element = <button onClick={() => shoot("goal")}>Click me</button>

root.render(element);
